    }
    render() {
        let lists = ['Hoodie','Shirt','Jacket','Sweatshirts','T-shirts','Dress','Shorts','Trousers','Shoes']
        let id = [['Hoodie']]
        return (
            <div>
                {/* <h1 className="text-warning">WARDROBE</h1> */}
                <div className='w-lists'>
                    <Wardrobe_list lists={lists} id={id}/>
                </div>
            </div>
        )
    }
}
